import React from "react";
import "../css/style.css";
import "font-awesome/css/font-awesome.min.css";
import "bootstrap-social";
import '../bootstrap/dist/css/bootstrap.min.css';

const Footer = () => {
  return (
    <footer className="d-flex flex-column">
      <div className="container">
        <div className="row">
          <div className="col-md-6 col-sm-12">
            <div className="footer-section">
              <h3>Information</h3>
              <p>
                Nguyen Trai High School, 01 Phan Van Dinh, Lien Chieu District, Da Nang City
              </p>
            </div>
          </div>

          <div className="col-md-6 col-sm-12">
            <div className="footer-section">
              <h3>Liên hệ</h3>
              <p>Email: thptnguyentraidng01@gmail.com</p>
              <p>Social Media:</p>
              <span className="mr-2"><i className="fa fa-facebook"></i></span>
              <span className="mr-2"><i className="fa fa-instagram"></i></span>
              <span className="mr-2"><i className="fa fa-envelope"></i></span>
              <span className="mr-2"><i className="fa fa-twitter"></i></span>
            </div>
          </div>
        </div>
      </div>

      <div className="mt-auto p-3 bg-dark text-light">
        TRƯỜNG THPT NGUYỄN TRÃI - ĐÀ NẴNG
      </div>
    </footer>
  );
};

export default Footer;
